import React from 'react';

export default class ToDoListItem extends React.Component{
    toDoList = ["Go to School", "Do Homeworks", "Come home"]

    render(){

        const toDoList = this.toDoList.map((listItem, index)=>{
            return <li class="list-group-item" key={index} id={index}>{listItem}</li>
        });

        return toDoList;
    }

}
